import Title from '../../Title';
import ThemeSwitcher from '../../ThemeSwitcher';
import { NavLink } from 'react-router-dom';

function Header() {
  return (
    <header>
      <Title />
      <NavLink to="/">
        <ThemeSwitcher />
      </NavLink>
    </header>
  );
}

export default Header;
